import style from "./Form.module.css";

const Form = () =>{
    return(
        <form>
            <h1 className={style.Title}> Crea tu Pokemon</h1>
            <div className={style.Container}>
                <label htmlFor="name">name:</label>
                <input type="text" name="name"></input>
            </div>
            <button type="submit">CREAR</button>
        </form>
    )
}

export default Form;
